import React from 'react'
import { Route, Routes, BrowserRouter } from 'react-router-dom'
import Home from './PAGES/HomePage/Home'

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
      <Route path="/home" element={<Home />}></Route>

      </Routes>
    </BrowserRouter>
  )
}

export default App
